フルバケットシートの超基準先進モデルジータ3。剛性をさらに高めた新設計のボディーシェル。高速時の横Ｇでのペダル操作性を大幅に高めたニーサポート部。ハイグレードファブリックと、耐久性を重視したハイグレードウレタン等。全ての性能において、2シリーズを遥かに超えました。<br><br>●使用シートレール：FO・FB・FK もしくはFGタイプ（各車両によりFO・FB・FK及びFGタイプいずれかの設定になります）・FXタイプ（FXタイプでもシートポジションは同等となります） ●保安基準適合モデル ●FIA公認モデル ●日本製 ●重量：約6.7Kg<br><br>※2名乗車以外の車両には背面にシートバックプロテクターが必要になります。 ※2ドアの4シーターの場合、左右同時にフルバケットを装着すると車検対応になりません。この場合2名乗車に乗車定員の変更申請が必要です。<br><br>汎用品<br><br><br><br>インテリア | シート<tr><td colspan="2">
