スタイリッシュかつスポーティーながら座面サイドを低く設定し、スポーツ車はもちろんミニバン、ワゴン車に装着しても乗り降りしやすいのが特徴です。座面の厚みを薄くしながらも乗り心地とホールド性能に妥協はありません。リクライニング機構はダイヤル式ではなくレバー式を採用。<br><br>●カラー：ブラック×レッド ●ステッチカラー：レッド ●取付位置：フロア ●全高：910mm ●全幅（肩幅）：500mm（左右レバー外側525mm） ●全長：520mm ●座面幅：500mm ●重量：13.4kg ●装着寸法：縦270mm×幅345mm/装着面フラット/8mmボルト<br><br>【注意】シートレールは専用品「vanner（バンナー）製スパルコR100専用」のみとなります。シートを装着の際は別途「vanner（バンナー）製スパルコR100専用」シートレールが別途必要となります。シートレールをご希望の際は備考欄に「シートレール希望」とご入力下さい。別途お見積り、ご相談させていただきます。<br><br>左右共通汎用品<br><br><br><br>インテリア/シート<tr><td colspan="2">
