汎用の後付けシートヒーターにもかかわらず、自由なサイズに切り取って調整できるヒーターを採用し、幅広い車種にぴったりとフィットします。市販のシートカバーと同時装着で簡単に取り付け可能です。ヒーターの取付は両面テープにてシートに固定し、その上にカバーをかぶせるだけで完了です。<br><br>■便利な2段階の温度調節機能付　■シートカバー内の取付の場合、シートカバー表面温度は概ね High45～50度前後、Low30度前後になります。（取付方法により異なります）※もちろん万が一の為のトラブル防止に温度ヒューズを内蔵。異常な温度上昇の際は自動停止します。 　■ヒーター　ｘ 2枚／温度切替スイッチ／リレー付ハーネス 付属<br><br>※左右両端は電極が通っているため絶対に切り離さないでください。　※やけど防止を考慮した温度設定になっておりますが、状況によっては、低温やけどの恐れがございます。コントロールスイッチにて温度を調整しご使用ください。<br><br>ユニバーサル <br><br>車検対応品<br><br>インテリア | インテリアその他<tr><td colspan="2">
